description:
Support relative resources in slices context files:

{noformat}
Caused by: java.lang.UnsupportedOperationException
	at org.springframework.slices.personality.internal.FileSystemEntryResource.createRelative(FileSystemEntryResource.java:38)
	at org.springframework.beans.factory.xml.DefaultBeanDefinitionDocumentReader.importBeanDefinitionResource(DefaultBeanDefinitionDocumentReader.java:201)
{noformat}

SpringApplicationSlicePersonality iterates through all the entries in a JAR file to try and detect a very specific pattern:
{code}
for (FileSystemEntry entry : sliceFile.getFileSystem(false)) {
    if (entry.getName().startsWith(SPRING_FILE_PREFIX)) {
        return true;
    }
}
return false;
{code}
Starting up an application would be much faster if the file system allowed more efficient querying.

Deadlock on ServiceWiringBeanFactoryPostprocessor: it seems this.monitor.wait() might never be notified if the slice application context fails to start.  See SpringApplicationSlicePersonality:

{code}
applicationContext.addBeanFactoryPostProcessor(slicePersonalitiesContext.getServiceWiringBeanFactoryPostProcessor());
applicationContext.load(getResources(sliceFile));

applicationContext.refresh();
applicationContext.start();
{code}

If the load or the refresh fails then there is a missing call to decrement the reference counter in the bean factory post processor.

I have two servlets in web.xml, one is the standard DispatchServlet, the other one is an ordinary servlet. In this ordinary servlet we need to use a service in the ApplicationContext created by the DispatchServlet, so I use the parameter "load-on-startup" to control the init order of these servlets. But according to the slice's source code,  it does not work.

Here is the code snippet from ServletManager.java:

 for (Map.Entry<String, ServletHolder> entry : servlets.entrySet()) {
                        ServletHolder holder = entry.getValue();
                        ServletConfig config = new ImmutableServletConfig(holder.getDefinition(), sliceServletContext);
                        holder.getInstance().init(config);
                        // TODO Log which servlet failed, and re-throw
                    }

It uses a set to keep the servlets.

Just use TypedStringValue instead of "primitive" types (String, long, Class, etc.).  E.g. in ReferenceBeanDefinitionParser:

{code}
beanDefinition.getConstructorArgumentValues().addIndexedArgumentValue(TIMEOUT_INDEX, Long.valueOf(timeout));
{code}

becomes

{code}
beanDefinition.getConstructorArgumentValues().addIndexedArgumentValue(TIMEOUT_INDEX, new TypedStringValue(timeout, Long.class));
{code}
